BS = 16
pad = lambda s: s + (BS - len(s) % BS) * chr(0)
unpad = lambda s: s[0:-ord(s[-1])]


# 将字符串转换成二进制的buff块
def parse_hex(hex_str):
    l = int(math.ceil(len(hex_str) / 2))
    buf = ''
    for i in range(0, l):
        s = hex_str[(i * 2):((i + 1) * 2)]
        buf = buf + chr(int(s, 16))
    return buf


